Bronze statue mounted on large rock with a metal plaque affixed to the face of the rock; the shape of the statue is the official badge of the society, called "The Bent": it is a watch key in the shape of a trestle (the load-bearing portion of a bridge); there are Greek letters of an ancient form on it's face (see Wikipedia for more info)

